[include led.cfg]
[exclude_object]
[include config_backup.cfg]

[printer]
max_velocity: 500
max_accel: 12500
max_accel_to_decel: 5000
square_corner_velocity: 15.0

[input_shaper]
shaper_freq_x: 91.4
shaper_freq_y: 51.4
shaper_type: mzv

[controller_fan controller_fan]
pin: PE5
hardware_pwm: True
kick_start_time: 0.500
max_power: 0.8
fan_speed: 0.5
off_below: 0.2
shutdown_speed: 0.5
heater: extruder, Chamber_Heater

[heater_fan toolhead_cooling_fan]
pin = toolboard:fan_toolhead_cooling_pin
fan_speed = 0.5

[fan]
pin: toolboard:PB3
enable_pin: toolboard:PA0
cycle_time: 0.00004

[extruder]
sensor_type: PT1000

[neopixel Toolhead_Light]
pin: toolboard:PD3
chain_count: 5
color_order: GRB

[neopixel Top_Light]
pin: PA9
chain_count: 73
color_order: GRB

[z_tilt]
speed: 500
z_positions = 
	0,0
	200,400
	400,0
points = 
	60,60
    340,60
    200,340
    
horizontal_move_z = 2
retries = 10
retry_tolerance = 0.01

[beacon]
trigger_distance: 1.5
y_offset: 21.6 

[bed_mesh]
speed: 500
probe_count: 340,34
mesh_min: 30,30
mesh_max: 370,370

[linear_movement_vibrations]
accel_chip: adxl345 toolboard
x_min: 20
x_max: 380
y_min: 20
y_max: 380
output_directory: /home/pi/printer_data/config/linear_vibrations/

[gcode_macro Beacon_Offset] 
gcode: BEACON_CALIBRATE

[gcode_macro GANTRY_WARMUP] 
gcode: 
        MAYBE_HOME 
        {% if printer.toolhead.position.z|int < 10 %} 
                G0 Z10 F25000 
        {% endif %} 
        {% set loop_count = params.ITERATIONS|default(5)|int %} 
        {% set eighth_x = (printer.toolhead.axis_maximum.x // 8)|int %} 
        {% set eighth_y = (printer.toolhead.axis_maximum.y // 8)|int %} 
        G0 X{eighth_x} Y{eighth_y} F100000 
        {% for var in range(0,loop_count) %} 
                M118 Iteration {var+1} of {loop_count} 
                G0 X{eighth_x} Y{eighth_y * 7} 
                G0 X{eighth_x * 7} Y{eighth_y * 7} 
                G0 X{eighth_x * 7} Y{eighth_y} 
                G0 X{eighth_x} Y{eighth_y} 
                G0 X{eighth_x * 4} Y{eighth_y * 4} 
                G2 J{eighth_y * 2} 
                G3 J{eighth_y * -2} 
        {% endfor %} 
        M118 Warmup Done

